		/// p2 is Global 10597 + i * 6. 'i' is a while(i &#38;lt; 70) loop<br/>
		/// p3 is again -1, 0 - 35 <br/>
		/// p4 is again -1, 0 - 35 <br/>
		/// p5 is either 0 or 1 (bool ?)<br/>
		/// p6 is either 0 or 1 (The func to determine this is bool)<br/>
		/// p7 is either 0 or 1 (The func to determine this is bool)<br/>
		/// p8 is either 0 or 1 (The func to determine this is bool)<br/>
		/// p9 is 0 - 3 (Determined by func_60 in dialogue_handler.c)<br/>
		/// p10 is either 0 or 1 (The func to determine this is bool)<br/>
		/// p11 is either 0 or 1 (The func to determine this is bool)<br/>
		/// p12 is unknown as in TU27 X360 scripts it only goes to p11.<br/>
		/// </remarks>
