		/// <summary>
		/// Parameters: const char* str1, const char* str2, BOOL matchCase, int maxLength
		/// </summary>
		/// <remarks>
		/// Compares two strings up to a specified number of characters.<br/>
		/// Parameters:<br/>
		/// str1 - String to be compared.<br/>
		/// str2 - String to be compared.<br/>
		/// matchCase - Comparison will be case-sensitive.<br/>
		/// maxLength - Maximum number of characters to compare. A value of -1 indicates an infinite length.<br/>
		/// Returns:<br/>
		/// A value indicating the relationship between the strings:<br/>
		/// &#38;lt;0 - The first non-matching character in 'str1' is less than the one in 'str2'. (e.g. 'A' &#38;lt; 'B', so result = -1)<br/>
		/// 0 - The contents of both strings are equal.<br/>
		/// &#38;gt;0 - The first non-matching character in 'str1' is less than the one in 'str2'. (e.g. 'B' &#38;gt; 'A', so result = 1)<br/>
		/// Examples:<br/>
		/// MISC::COMPARE_STRINGS("STRING", "string", false, -1); // 0; equal<br/>
		/// MISC::COMPARE_STRINGS("TESTING", "test", false, 4); // 0; equal<br/>
		/// MISC::COMPARE_STRINGS("R2D2", "R2xx", false, 2); // 0; equal<br/>
		/// MISC::COMPARE_STRINGS("foo", "bar", false, -1); // 4; 'f' &#38;gt; 'b'<br/>
		/// MISC::COMPARE_STRINGS("A", "A", true, 1); // 0; equal<br/>
		/// When comparing case-sensitive strings, lower-case characters are greater than upper-case characters:<br/>
		/// MISC::COMPARE_STRINGS("A", "a", true, 1); // -1; 'A' &#38;lt; 'a'<br/>
		/// MISC::COMPARE_STRINGS("a", "A", true, 1); // 1; 'a' &#38;gt; 'A'<br/>
		/// </remarks>
		/// <returns>int</returns>
		COMPARE_STRINGS = 0x1E34710ECD4AB0EB, // 0xFE25A58F

